import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';
import { FaAngleDown } from "react-icons/fa";

function Home() {
  return (
    <section className="hero">
      <h1>Bienvenidos a Fondos.com</h1>
      <p>Tu sitio de información y servicios financieros</p>
    </section>
  );
}

function App() {
  return (
    <Router>
      <div className="background-container">
        <header className="header">
          <div className="logo">fondos.com</div>
          <nav className="nav">
            <Link className="navItem" to="/">
              <img src="/home.png" alt="Home" className="icon" /> Home
            </Link>
            <Link className="navItem" to="/contacto">
              <img src="/down.svg" alt="Contacto" className="icon" /> Contacto
            </Link>
          </nav>
        </header>
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            {/* Agregar otras rutas aquí si es necesario */}
          </Routes>
        </main>
      </div>
    </Router>
  );

}

export default App;
